import React from 'react';
import MainPage from './MainPage'
import Chats from './Chats';
import Profile from './Profile';
import Icon from 'react-native-vector-icons/Ionicons';
import Icon2 from '@expo/vector-icons/Entypo';

import { createMaterialTopTabNavigator } from '@react-navigation/material-top-tabs';


const Tab = createMaterialTopTabNavigator();
export class BottomTabNavigator extends Component {
    componentDidMount() {
        this.props.fetchUser();
    }
    render(){
    return (
        <Tab.Navigator 
            tabBarOptions={{
                activeTintColor:'#f2404c',
                inactiveTintColor:'#000119',
                style:{
                    height:95,
                    justifyContent:'center',
                    paddingVertical:33,
                    backgroundColor:'#FFF',
                    elevation:2
                }
            }}
        >
                <Tab.Screen
                    name='MainPage'
                    component={MainPage}
                    navigation={this.props.navigation}
                    options={{
                        tabBarLabel:'Main',
                        // tabBarIcon:({color,size})=>(
                        //     <Icon name="copy-outline" size={30} color={color} />

                        // )
                    }}
                />
                 <Tab.Screen
                    name='Chats'
                    component={Chats}
                    navigation={this.props.navigation}
                    options={{
                        tabBarLabel:'Chats',
                        // tabBarIcon:({color,size})=>(
                        //     <Icon2 name='chat' color={color} size={30}/>

                        // )
                    }}
                />
                 <Tab.Screen
                    name='Profile'
                    component={Profile}
                    navigation={this.props.navigation}
                    options={{
                        tabBarLabel:'Profile',
                        // tabBarIcon:({color,size})=>(
                        //     <Icon name='ios-person' color={color} size={30}/>

                        // )
                    }}
                />
        </Tab.Navigator>
    );
};
}
export default BottomTabNavigator;
